import React from "react";

function AuctionList() {
  const auctions = [
    {
      id: 1,
      isin: "IN1234567890",
      name: "HDFC 2028 Auction",
      status: "Open",
      notional: "₹50 Cr",
      endsAt: "Today 3:00 PM",
    },
    {
      id: 2,
      isin: "IN9876543210",
      name: "SBI 2027 Auction",
      status: "Upcoming",
      notional: "₹30 Cr",
      startsAt: "Tomorrow 11:00 AM",
    },
  ];

  return (
    <div className="p-6 space-y-6">
      <h1 className="text-2xl font-semibold text-gray-800">Auctions</h1>

      <div className="bg-white rounded-xl shadow-sm border divide-y">
        {auctions.map((a) => (
          <div
            key={a.id}
            className="flex flex-col md:flex-row md:items-center justify-between p-4 gap-4"
          >
            <div>
              <p className="font-medium">{a.name}</p>
              <p className="text-sm text-gray-500">ISIN: {a.isin}</p>
              <p className="text-xs text-gray-400">
                {a.status === "Open" ? a.endsAt : a.startsAt}
              </p>
            </div>
            <div className="flex gap-4 items-center">
              <span
                className={`px-3 py-1 rounded-lg text-xs font-medium ${
                  a.status === "Open"
                    ? "bg-green-100 text-green-700"
                    : a.status === "Upcoming"
                    ? "bg-yellow-100 text-yellow-700"
                    : "bg-gray-100 text-gray-600"
                }`}
              >
                {a.status}
              </span>
              <button className="px-3 py-1 text-sm border rounded-lg hover:bg-gray-50">
                View
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default AuctionList;
